void MRICapsule::applyPIDControl(uint16_t prjAxis)
{
	//double errX = PRJ_SIZE/2 - m_positionIndex[0][0];
	//double errZ = PRJ_SIZE/2 - m_positionIndex[0][1];
	double errX = m_wayPoints[m_state] - m_positionIndex[0][0];
	double errZ = m_wayPoints[m_state] - m_positionIndex[0][1];
	
	double momentum;
	const double INTEGRAL_MAX = 20;
	if (prjAxis == 1)
	{	
		
		if(m_state == 0 ||  m_state == 2 || m_state == 6 || m_state == 7 || m_state == 8 || m_state == 9 || m_state == 12 || m_state == 13 || m_state == 15)
		{
			momentum = ((m_PGain)*errX)-((m_DGain)*m_velocity[0][0]);
		}
		else
		{
			momentum = ((m_PGain *2.5)*errX)-((m_DGain)*m_velocity[0][0]);
		}
		
		ICE_OUT("m_PGain " << m_PGain << " momentum P: " << m_PGain*errX <<" momentum D: " << m_DGain*m_velocity[0][0]<<" m_maxGradAmplitude " << m_maxGradAmplitude);
		ICE_OUT("momentum " << momentum <<" m_imagingMomentum " << m_imagingMomentum);

		if(abs(m_spoilerTs) > 0.0000000001)
			m_uValx = (momentum - m_imagingMomentum)/(m_spoilerTs/1000);
		else
			m_uValx = 0;


		ICE_OUT("m_spoilerTs "<< m_spoilerTs << " err: " << errX <<" speed: "<<m_velocity[0][0] );

		if(m_uValx > m_maxGradAmplitude)
			m_uValx = m_maxGradAmplitude;
		if(m_uValx < -1*m_maxGradAmplitude)
			m_uValx = -1*m_maxGradAmplitude;

	}
	else
	{
		// ensure that the integral error has the same sign as the error.
		if (errX*m_intPIX < 0)
			m_intPIX = 0.0;

		m_intPIX += errX;

		if (m_intPIX > INTEGRAL_MAX ) // Prevent integral windup
			m_intPIX = INTEGRAL_MAX; 
		else if (m_intPIX < -INTEGRAL_MAX )
			m_intPIX = -INTEGRAL_MAX; 

		m_uValx = (((m_PGain*errX)+(m_IGain * m_intPIX)));

		if(m_uValx > m_maxGradAmplitude)
			m_uValx = m_maxGradAmplitude;
		if(m_uValx < -1*m_maxGradAmplitude)
			m_uValx = -1*m_maxGradAmplitude;

		// ensure that the integral error has the same sign as the error.
		if (errZ*m_intPIZ < 0)
			m_intPIZ = 0.0;

		m_intPIZ += errZ; 

		if (m_intPIZ > INTEGRAL_MAX ) // Prevent integral windup
			m_intPIZ = INTEGRAL_MAX; 
		else if (m_intPIZ < -INTEGRAL_MAX )
			m_intPIZ = -INTEGRAL_MAX; 

		m_uValz = (((m_PGain*errZ)+(m_IGain * m_intPIZ)));

		if(m_uValz > m_maxGradAmplitude)
			m_uValz = m_maxGradAmplitude;
		if(m_uValz < -1*m_maxGradAmplitude)
			m_uValz = -1*m_maxGradAmplitude;

		m_uValy = 23.0;
	}
	//ICE_OUT("position " <<position << " target " << m_targetTheta[0] <<" err "   << err << " m_intPI " << m_intPI << " P " << m_PGain << " I " << m_IGain  );
	//ICE_OUT("Gx " << u  );

}
